import React from "react";
import "./style.css";
import {Images} from '../../config/image'
function Menu() {
  return (
    <div>
     <div className="menu">
     <div style={{display:"flex",justifyContent:"center"}}>
        <div className="left-menu">
        <div style={{display:"flex",justifyContent:"center"}}>
          <img src={Images.LOGIN} style={{ width: "30%", }} />
          {/* <div className="component-left">|</div> */}

          <div className="component-left">Trang Chủ</div>
          <div className="component-left">Hợp tác</div>
          <div className="component-left">Tin tức</div>
          <div className="component-left">Liên hệ</div>
          </div>
        </div>
        <div className="right-menu">
            <div className="component-right">ĐĂNG NHẬP</div>
            <div className="component-right">ĐĂNG KÝ</div>
        </div>
        </div>
      </div>
    </div>
  );
}

export default Menu;
